import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router } from 'react-router-dom';
import Header from './components/Header';
import Hero from './components/Hero';

function App() {
  return (
    <Router>
    <div className="App">
      <Header/>
      <Hero/>

    </div>
    </Router>
  );
}

export default App;
